    false,nt"url": null,nt"notes": "The purpose of this report is to summarize
    existing and observed trends in temperature and precipitation patterns and forecast
    climate change projections near the Humboldt Bay National Wildlife Refuge (HBNWR),
    and to summarize literature on sea level rise in relation to abiotic threats to
    refuge ecosystems . This report is in support of a Natural Resources Management
    Plan (NRMP) for the refuge. The mean monthly temperature near HBNWR from 1984 to
    2013 ranged from 41.1 to 61.4 u00b0F with minimum temperatures in January and December
    and maximum temperatures in August. One might expect a greater likelihood of warmer
    conditions near HBNWR during El Niu00f1o, the warm phase of Pacific Decadal Oscillation,
    and positive phase Pacific North American pattern. Historically (1910-2014), temperature
    has already increased over many seasons and months over several time periods tested,
    but only cool season maximum temperatures near HBNWR continued to show increasing
    trends after 1985 through 2014. Within and near HBNWR, changes in 30-year forecasts
    for precipitation and recharge (values were uncertain among models, showing either
    decreases or increases by 2100. Maximum and minimum temperature increased under
    all model and emission scenarios through 2100 (figure 15). Water demand increased
    under all model and emission scenarios through 2100. A previous study showed that
    sea level has already risen from 0.1 to 0.23 inches per year within and near HBNWR.
    Rates of subsidence were measured to range from -0.01 to u2013 0.14 inches per year,
    which exacerbate the impact from rising sea levels. Sea levels north of Cape Mendocino
    (12 miles south of the Humboldt Bay spit) are projected to change -1.6 (sea level
    fall) to +9 inches (sea level rise) by 2030, 12 inches by 2050, -1 to 18.9 inches
    by 2050, and 3.9 to 56.2 inches by 2100.",nt"license_title": "License Not
